import React, { Component } from 'react'

export default class Clientview extends Component {
  constructor(props) {
    super(props)
    this.state = {
      clientview: this.props.nombre
    }
  }



  render() {
    return (
      <React.Fragment>
        <h4 className="retroshadow"></h4>
        <div class="clientview">
          {this.props.nombre}
        </div>
        {/* <img src={}/> */}
      </React.Fragment>
    )
  }
}
